import React from "react";
import logo from "./logo-peach.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="logo" className='w3' />
        <h1>Elizabeth Porter</h1>
      </header>
      <section>
        <h2>Full Stack Web Developer</h2>
      </section>
    </div>
  );
}

export default App;
